      return "\u091f\u0947\u0915\u094d\u0938\u094d\u091f \u092c\u091f\u0928 \u0915\u094b \u0926\u092c\u093e\u0928\u0947 \u092a\u0930 \u0935\u0939 \u092b\u0948\u0932\u0940 \u0939\u0941\u0908 \u0938\u094d\u092f\u093e\u0939\u0940 \u091c\u0948\u0938\u093e \u0926\u093f\u0916\u0924\u093e \u0939\u0948, \u0932\u0947\u0915\u093f\u0928 \u0935\u0939 \u090a\u092a\u0930 \u0915\u0940 \u0913\u0930 \u0909\u0920\u093e \u0939\u0941\u0906 \u0928\u0939\u0940\u0902 \u0926\u093f\u0916\u0924\u093e. \u091f\u0942\u0932\u092c\u093e\u0930, \u0921\u093e\u092f\u0932\u0949\u0917, \u0914\u0930 \u092a\u0948\u0921\u093f\u0902\u0917 \u0935\u093e\u0932\u0947 \u0907\u0928\u0932\u093e\u0907\u0928 \u0915\u0947 \u0938\u093e\u0925 \u091f\u0947\u0915\u094d\u0938\u094d\u091f \u092c\u091f\u0928 \u0915\u093e \u0907\u0938\u094d\u0924\u0947\u092e\u093e\u0932 \u0915\u0930\u0947\u0902";
